## 3. Frustrated inequalities

An interesting situation arises when considering classification with $M=1, D=2$, and $N_{\mathrm{n}}=4$. Assuming that the input edges are not co-incident on any node, it is necessary that the four output nodes be adjacent to the input edges since there are no other nodes in the network. The situation we will describe in fact happens whenever the output nodes and input edges are adjacent, so can consider a more general setting (with arbitrary $N_{\mathrm{n}}$ ) in which class 1 is at node $i$, class 2 at node $j$, class 3 at node $k$, and class 4 at node $l$. Accounting for the fact that

$\zeta_{1,1}^{1}=\zeta_{1,1,-1}^{1}=\zeta_{1,1}^{2}=\zeta_{1,-1}^{2}=\zeta_{1,-1}^{3}=\zeta_{1,1,-1}^{3}=\zeta_{1,1}^{4}=\zeta_{-1,1}^{4}=0$, the four inequalities which must be satisfied to solve the four-class classification problem are

$$
\begin{aligned}
\zeta_{1,1}^{1} & >\zeta_{1,1}^{2} \\
\zeta_{-1,1}^{2} & >\zeta_{-1,1}^{3} \\
\zeta_{-1,-1}^{3} & >\zeta_{-1,-1}^{4} \\
\zeta_{1,-1}^{4} & >\zeta_{1,-1}^{1}
\end{aligned}
$$

We may divide each of these inequalities by the product of edge rates which factor out on both sides, so that

$$
\begin{aligned}
\frac{\zeta_{1,1}^{1}}{W_{i j} W_{k l}} & >\frac{\zeta_{1,1}^{2}}{W_{i j} W_{k l}} \\
\frac{\zeta_{-1,1}^{2}}{W_{j i} W_{k l}} & >\frac{\zeta_{-1,1}^{3}}{W_{j i} W_{k l}} \\
\frac{\zeta_{-1,-1}^{3}}{W_{j i} W_{l k}} & >\frac{\zeta_{-1,-1}^{4}}{W_{j i} W_{l k}} \\
\frac{\zeta_{1,-1}^{4}}{W_{i j} W_{l k}} & >\frac{\zeta_{1,-1}^{1}}{W_{i j} W_{l k}}
\end{aligned}
$$

Now we use the fact that since the output nodes are adjacent to the input edges they must obey Equations 57, 59, 66 , and 68. Substituting from these equations, we arrive at

$$
\begin{aligned}
\frac{\zeta_{-1,1}^{3}}{W_{j i} W_{k l}} & >\frac{\zeta_{1,1}^{2}}{W_{i j} W_{k l}} \\
\frac{\zeta_{-1,1}^{2}}{W_{j i} W_{k l}} & >\frac{\zeta_{-1,1}^{3}}{W_{j i} W_{k l}} \\
\frac{\zeta_{-1,-1}^{3}}{W_{j i} W_{l k}} & >\frac{\zeta_{-1,1}^{2}}{W_{j i} W_{k l}} \\
\frac{\zeta_{1,1}^{2}}{W_{i j} W_{k l}} & >\frac{\zeta_{-1,-1}^{3}}{W_{j i} W_{l k}}
\end{aligned}
$$

One can see that this set of inequalities is contradictory. As a result, four-class classification is impossible for $N_{\mathrm{n}}=4$, or more generally when the output nodes are adjacent to the input edges.
